import React from "react";
import line from "../images/line.png";
import { useNavigate } from "react-router-dom";

function SideHeader() {
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate("/");
  };

  return (
    <div>
      <div style={{ textAlign: "center", color: "#474444", fontWeight: "600" }}>
        <p style={{ marginTop: "4vh", fontSize: "2em" }}>QUIZZIE</p>
        <div style={{ fontSize: "1.4em" }}>
          <p
            style={{
              marginTop: "24vh",
             
              backgroundColor: "pink",
            }}
          >
            Dashboard
          </p>
          <p style={{ marginTop: "8vh" }}>Analytics</p>
          <p style={{ marginTop: "8vh" }}>Create Quiz</p>
        </div>
        <p style={{ marginTop: "23vh" }}>
          <img src={line} alt="line" />
        </p>
        <p
          onClick={handleLogout}
          style={{
            marginTop: "4vh",
            fontSize: "1.6em",
            marginBottom: "2vh",
            cursor: "pointer",
          }}
        >
          Logout
        </p>
      </div>
    </div>
  );
}

export default SideHeader;
